import React from "react";

function Ol(){
    return(
        <ol> 
            <li> Khushbu </li>
            <li> Chetna </li>
            <li> Ritu </li>
            <li> Ahinsa </li>
            <li> Kajal</li>
        </ol>
    );
}

export default Ol;
